import React from 'react';

const WelcomeBack =props=>{
    return(
        <div style={styles.container}>
            <img  width='20px' height='20px' src={require('../../images/pinterest.png')} alt="logo"/>
            <p>Welcome back PRW!</p>
            <img src="../../images/Screenshot at Jan 08 14-07-34.png" alt=""/>
            <p>prwlecture@gmail.com</p>
        </div>
    )
}

export default WelcomeBack;

const styles={
    container:{
        backgroundColor:'white',
        display:'flex',
        flexDirection:'column',
        alignItems:'center',
        textAlign:'center',
        padding:'10px',
    }
}
